import Link from 'next/link';
import { withAmp } from 'next/amp'

export const config = { amp: true };

const linkStyle = {
  marginRight: 15,
  'text-decoration': 'none',
  decoration: 'none'
};

function Header() {
  return (
  <header>
    <style jsx>{`
        @font-face {
            font-family: 'Bai Jamjuree';
            font-style: sans-serif;
            src: url('https://fonts.googleapis.com/css?family=Bai+Jamjuree');
        }
        header {
            font-family: 'Bai Jamjuree', sans-serif;
            position: fixed;
            height: 2em;
            left: 0;
            top: 0;
            width: 100%;
            background-color: #07c1b98a;
            padding: 1vh 0 1vh 0;
        }
        .name {
          text-align:center;
          top: calc(50% - 16px);
          left: 50%;
          transform: translate(-50%, -50%);  
        }
    `}</style>
    <span className="links">
      <Link href="/resume">
        <a style={linkStyle}>Resume</a>
      </Link>
      <Link href="/posts">
        <a style={linkStyle}>Posts</a>
      </Link>
      <Link href="/talks">
        <a style={linkStyle}>Talks</a>
      </Link>
    </span>

    <Link href="/" className="name">
      <a style={linkStyle}>Naina Raisinghani</a>
    </Link>

  </header>
)};

export default Header;
